import React from "react";
import logo from "./logo.svg";
import { Card, Grid, Typography } from "@mui/material";

function App() {
  const style = {
    padding: "16px",
  };
  return (
    <Card style={style}>
      <Grid>
        <Typography>Some cool work</Typography>
        <Typography>2021</Typography>
        <Typography>This work is very cool</Typography>
      </Grid>
    </Card>
  );
}

export default App;
